import styled from "styled-components";

export const StyledTitle = styled.h1`
  &&& {
    font-family: Futura;
    font-style: normal;
    font-weight: bold;
    font-size: 64px;
    line-height: 85px;
    /* identical to box height */
    padding-top: 355px;
    color: #ffffff;
  }
`;

export const StyledDescription = styled.p`
  &&& {
    font-family: Futura;
    font-style: normal;
    font-weight: 500;
    font-size: 32px;
    line-height: 42px;
    /* identical to box height */

    color: #ffffff;
  }
`;

export const StyledHeader = styled.h2`
  &&& {
    text-align: left;
    font-family: Futura;
    font-style: normal;
    font-weight: bold;
    font-size: 32px;
    line-height: 43px;
    /* identical to box height */
    margin-bottom: 30px;
    color: #ffffff;
  }
`;
